// IMAGEM 1

// pegando a imagem
// dessa forma pode atribuir o comando src

const myImage = new Image();
myImage.src = "data:image/png;base64,";


// IMAGEM 1

// para a imagem não quebrar, dependendo do provedor ou davelocidade da interne passa a imagem, como string, através da base64, e dentro da função load(), para carregar a imagem

myImage.addEventListener("load", function () {
  // a const canvas é para pegar o elemento canvas
  const canvas = document.getElementById("canvas1");
  // a const ctx é para ter os métodos de desenho do canvas disponíveis
  const ctx = canvas.getContext("2d");
  canvas.width = 300;
  canvas.height = 500;

  // Para desenhar no canvas, passa se o draw
  // Há 3 formas formas,
  //   // será usado aqui a  que espera 5 argumentos
  //   // o primeiro:
  //   //                1. A imagem que quero
  //   //                2. e 3. O númenro 0 (zero) é passado duas vezes, é para aparecer no canto superior esquerdo e cobrir toda a area do canvas
  //   //                4. e 5.  canvas.width, canvas.height
  // const pixels = ctx.getImageData(0, 0, canvas.width, canvas.height);


  let particlesArray = [];
  // essa const numberOfParticles, é usada para definir a quantidade particulas que caem em cima da imagem
  const numberOfParticles = 5000;

  // é criado uma classe particulas,
  // ela será usada para criar as 5000 particulas iguais
  // essas 5000 mil particulas serão adicionadas ao Arraty vazio, criado anteriormente:
  //                            let particlesArray = [];
  // o constructor() da classe Particulas receberá cada aprticula individualmente
  // O x receberá um número aletório entre 0 e a LARGURA da tela
  // para as particulas se espalharem, é definido o inicio da coordenada horizontal em 0.
  //para a velocidade, é definido inicialmente em 0
  // a velocidade de queda erá um númento aleatório entre 0  e 3.5
  // a velocidade de queda também depende do brilho da imagem
  // quanto MENOS brilho, mais rapido a queda
  // quanto MAIS brilho, mais rapido a queda
  // this.velocity, o random() é multiplicado por 0.5, isso é apenas para dar mais aleatoriedade
  // o tamanho também terá uma aleatoriedade entre 1 e 2.5
  class Particles {
    constructor() {
      this.x = Math.random() * canvas.width;
      this.y = 0;
      this.speed = 0;
      this.velocity = Math.random() * 3.5;
      this.size = Math.random() * 1.5 + 1;
    }

    // aqui será criado um método para atuzalização das particulas, quadro a quadro, o: this.y += this.velocity.
    // esse this.y+= velocity fará com que após as particulas chegarem no final retornam para o inicio da imagem e caem novamente, ams agora o this.y, rceve a velocity e caem de forma diferente da anterior

    // quando as particulas chegarem no final do canvas, elas receberão um if(), redefinindo elas para o início da tela em 0,
    // e cairão novamente de forma aleatória

    //
    update() {
      this.y += this.velocity;
      if (this.y >= canvas.height) {
        this.y = 0;
        this.x = Math.random() * canvas.width;
      }
    }

    // o metodo draw faz um circulo, e desenha cada particula,    



    // o método draw de desnho, desenhará  de desenho específico, ou seja, AQUI ELE FARÁ um circulo representando APENAS UMA PARTICULA.
    // começara com um estilo em branco
    // o ctx arc() para desenhar um arco de particulas sobre  imagem, ddando o aspecto de terra caindo sobre a imagem em auto relevo, passa os parâmetros tamanho de x à y, angulo inicil e angulo final da imagem
    // o fill() é chamado aqui para preenchera o circulo da partucla 
    draw() {
      ctx.beginPath();
      ctx.fillStyle = "white";
      ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2);
      ctx.fill();
      // //
    }
  }
  // a function init() é reponsavel para iniciar um loop qua ficará acontecendo e passando o total de particulas passadas anterioremnte ou seja, 5000.
  // cada vez que o loop aconetce o Array vazio é chamado:
  //                                                        let particlesArray = [];
  // CADA VEZ QUE O FOR ACONTECE ELE PEGA AS UMA DAS 5000 PARTICULAS E COLOCA NO ARRAY FAZIO,
  // E CHAMA A CLASS PARTICULA() (NEW PARTICULAS()), E ESSA CLASSE TEM TODO O MAQUINÁRIO:
  //                  - O TAMNAHO
  //                  - VELOCIDADE
  //                  - AS FUNÇÕES RANDOMS()
  //                  - O METODO UPDATE()
  //                  - O MÉTODO DRAW()
  // QUE CONTRUIRÁ UMA NOVA PARTICULA
  // NO PRIMENRO LOOP TEREMOS APENAS UMA PARTICULA, ISSO ACONTECERÁ AS 5000 VEZES ATÉ PREENCHE TODO O ARRAY COM AS 5000 PARTICULAS PASSADAS, CRIANDO OBEJETOS (PARTICULAS EM BRANCO), DENTRO DESSE ARRAY.
  // esse for apenas cricou e colocou as particulas dentro desse array   
  function init() {
    for (let i = 0; i < numberOfParticles; i += 1) {
      particlesArray.push(new Particles());
    }
  }
  init();


  // para animar as particulas, 
  // é criado um loop de animação 
  // cria-se um retangulo preto semi transparente, o ctx.globalAlpha = 0.05;
  // isso fará um aspecto de desaparecimento da imagem gradul,
  // que acontecerá de forma gradual de acordo com o valor passado dentro do valore recebido pelo Alpha
  // quanto MAIOR o números de zeros antes do ponto, mais CLARO E LENTO vai ficando a imagem
  // quanto MENOR o números de zeros antes do ponto, OU SEJA, NÚMENROS INTEIROS, mais ESCURO E mais RÁPIDO vai ficando a imagem
  // após a imagem esvaecer, é criado um quadro preto pelo ctx.fillStyle(), esse fillstyle() passa apenas a cor
  // o fillRect() desenha o quadro com as dimensões necessárias, ou seja, em cima do canvas criado no começo do trabalho
  // Esse for percorre todo  arrray criado com as particulas, no for anterior que apenas criava as particulas.
  // depois de percorrer todo o for ele recalcula cada posição desse objeto particulas, e anima essas particulas dentro do canvas, dando o aspecto de queda. 

  // mas só isso não fasz animação, tem que chamar o  
  // requestAnimationFrame(animate) e passar a função dentro dela
  function animate() {
    // o ctx.drawImage(myImage, 0, 0, canvas.width, canvas.height);
    // foi tirado de onde estava e colocado aqui temporariamete para podermos ver a imagem original, onde ela estava, em cima do :  let particlesArray = []; a imagem desaparecia após algus segundos
    ctx.drawImage(myImage, 0, 0, canvas.width, canvas.height);
    ctx.globalAlpha = 0.05;
    // // 
    ctx.fillStyle = "rgb(0, 0, 0)";
    ctx.fillRect(0, 0, canvas.width, canvas.height);
    for (let i = 0; i < particlesArray.length; i += 1) {
      particlesArray[i].update();
      particlesArray[i].draw();
    }
    //  o métod requestAnimationFrame(animate) é mais sutil na transição dos frames da animação, que o for, ou randon()
    // o metodo requestAnimationFrame(), cria uma recursão repetidamente, e repetidamente
    requestAnimationFrame(animate);
  }
  animate();
});




